import { Stack, TextField } from "@mui/material";
import { createTheme } from '@mui/material/styles';

const theme = createTheme({
    palette: {
      primary: {
        main: 'red',
      },
    },
  });

const Form = () => {
    return (
        <Stack gap={3} >

            <TextField  label="Number of Questions" variant="outlined" color="primary">Number of Questions</TextField>
            <TextField id="outlined-basic" label="Category" variant="outlined">Category</TextField>
            <TextField id="outlined-basic" label="Difficulty" variant="outlined">Difficulty</TextField>
            <TextField id="outlined-basic" label="Type" variant="outlined">Type</TextField>

        </Stack>
    );
};

export default Form;
